import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { PlusOutlined } from '@ant-design/icons';
import { Button, Col, Drawer, Form, Input, Row, Space, Table, Tag, Modal } from 'antd';

const App = () => {
  const [data, setData] = useState([]);
  const [isModalVisible, setIsModalVisible] = useState(false);
  const [currentRecord, setCurrentRecord] = useState(null);
  const [form] = Form.useForm();
  const [open, setOpen] = useState(false);
  const [drawerForm] = Form.useForm();

  useEffect(() => {
    // Load initial data from your backend or local storage
  }, []);

  const handleDrawerSubmit = () => {
    drawerForm
      .validateFields()
      .then((values) => {
        const newData = {
          ...values,
          key: Date.now().toString(), // Use a timestamp as a unique key
          tags: values.tags.split(',').map((tag) => tag.trim()),
        };
        const updatedData = [...data, newData];
        setData(updatedData);
        saveDataToGitHub(newData);
        setOpen(false);
        drawerForm.resetFields();
      })
      .catch((info) => {
        console.log('Validate Failed:', info);
      });
  };

  const saveDataToGitHub = async (accountData) => {
    try {
      await axios.post('http://localhost:3000/saveAccount', { accountData });
      console.log('Account data saved to GitHub');
    } catch (error) {
      console.error('Failed to save account data:', error);
    }
  };

  const columns = [
    // ... your columns definition
  ];

  return (
    <>
      <Button type="primary" onClick={showDrawer} icon={<PlusOutlined />}>
        New account
      </Button>
      <Table columns={columns} dataSource={data} />
      <Drawer
        // ... your Drawer definition
      >
        <Form layout="vertical" hideRequiredMark form={drawerForm}>
          <Row gutter={16}>
            <Col span={12}>
              <Form.Item
                name="name"
                label="Name"
                rules={[
                  {
                    required: true,
                    message: 'Please enter user name',
                  },
                ]}
              >
                <Input placeholder="Please enter user name" />
              </Form.Item>
            </Col>
            <Col span={12}>
              <Form.Item
                name="age"
                label="Age"
                rules={[
                  {
                    required: true,
                    message: 'Please enter age',
                  },
                ]}
              >
                <Input type="number" placeholder="Please enter age" />
              </Form.Item>
            </Col>
          </Row>
          <Row gutter={16}>
            <Col span={12}>
              <Form.Item
                name="skills"
                label="Skills"
                rules={[
                  {
                    required: true,
                    message: 'Please enter skills',
                  },
                ]}
              >
                <Input placeholder="Please enter skills" />
              </Form.Item>
            </Col>
            <Col span={12}>
              <Form.Item
                name="tags"
                label="Tags"
                rules={[
                  {
                    required: true,
                    message: 'Please enter tags (comma separated)',
                  },
                ]}
              >
                <Input placeholder="Please enter tags (comma separated)" />
              </Form.Item>
            </Col>
          </Row>
        </Form>
      </Drawer>
      <Modal
        // ... your Modal definition
      >
        <Form form={form} layout="vertical" name="form_in_modal">
          <Form.Item
            name="name"
            label="Name"
            rules={[{ required: true, message: 'Please input the name!' }]}
          >
            <Input />
          </Form.Item>
          <Form.Item
            name="age"
            label="Age"
            rules={[{ required: true, message: 'Please input the age!' }]}
          >
            <Input type="number" />
          </Form.Item>
          <Form.Item
            name="skills"
            label="Skills"
            rules={[{ required: true, message: 'Please input the skills!' }]}
          >
            <Input />
          </Form.Item>
          <Form.Item
            name="tags"
            label="Tags"
            rules={[{ required: true, message: 'Please input the tags!' }]}
          >
            <Input />
          </Form.Item>
        </Form>
      </Modal>
    </>
  );
};

export default App;
